	FX.Menu = {
		init: function () {
			this.bind();


		},
		bind: function () {
			var $menu = $('#top-menu');

			$menu.find(".menu-item").on('touchstart', function () {
				var $item = $(this),
					$submenu = $item.find('.sub-menu');


				if ($(window).width() > 1025) {
					$submenu.toggleClass("active");
				}


			})
		}
	};

