	FX.PopUp = {
		init: function () {
			this.bind();
		},
		bind: function () {
			$(".pl_video-sec__imgbox").on('click', function () {
				$(this).siblings('.pl_video-sec__vid').css('display', 'flex');
			})

			$(".pl_video-sec__vid-close").on('click', function () {
				$(this).parents('.pl_video-sec__vid').css('display', 'none');
			})
		}
	};

	/**
	 * General functionality — ideal for one-liners or super-duper short code blocks
	 */
	FX.SingleToggle = {
		init: function () {
			this.bind();
		},
		bind: function () {
			var width = $(window).width();

			if (width < 1025) {
				$(".fx-single-toggle__title, .fx-single-toggle__title:after")
					.on('click', function () {
						var $this = $(this),
							activeClass = "fx-single-toggle__active",
							$content = $this.parents('.fx-single-toggle__container')
								.find('.fx-single-toggle__item');

						if ($this.hasClass(activeClass)) {
							$this.removeClass(activeClass);
							$content.slideUp();

						} else {
							$this.addClass(activeClass);
							$content.slideDown();

						}

					});
			}

		}
	};

